INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(3, 'Dark Souls III', 4, 8, 'About\r\nDark Souls III is the fourth installment in the Dark Souls series, now introducing the players to the world of Lothric, a kingdom which has suffered the fate similar to its counterparts from the previous games, descending from its height to utter darkness. A new tale of dark fantasy offers to create and guide the path of game’s protagonist, the Ashen One, through the dangers of the world before him.\r\nSharing many gameplay similarities with previous installments of the Souls series, Dark Souls III improves at what it is best. These features are the unforgiving difficulty and unique, overwhelming environments. Let alone the soundtracks, allowing players to travel through the familiar locations and encounter new obstacles alike, resulting in a great test of nerves, while also giving the fruit of resolving the secrets and echoes of the past of Dark Souls series.\r\nThe new changes to the systems of multiplayer, crafting and combat will offer new and experienced players to challenge themselves on the field of battle, and to enhance the playthrough with each consecutive New Game +, where the in-game cycle never indeed ends, allowing for a multitude of different playstyles, and showing different events based on player’s actions.', 185, 1440, 'data:image/jpeg;base64,', 9);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(4, 'Elden Ring', 5, 8, 'About\r\nThe Golden Order has been broken.\r\n\r\nRise, Tarnished, and be guided by grace to brandish the power of the Elden Ring and become an Elden Lord in the Lands Between.\r\n\r\nIn the Lands Between ruled by Queen Marika the Eternal, the Elden Ring, the source of the Erdtree, has been shattered.\r\n\r\nMarika\'s offspring, demigods all, claimed the shards of the Elden Ring known as the Great Runes, and the mad taint of their newfound strength triggered a war: The Shattering. A war that meant abandonment by the Greater Will.\r\n\r\nAnd now the guidance of grace will be brought to the Tarnished who were spurned by the grace of gold and exiled from the Lands Between. Ye dead who yet live, your grace long lost, follow the path to the Lands Between beyond the foggy sea to stand before the Elden Ring.\r\n\r\n', 258, 1484, 'data:image/jpeg;base64,', 9);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(5, 'Lords of the Fallen', 1, 9, 'About\r\nLords of the Fallen is an action RPG, which is set in the fictional world abandoned by Gods and occupied by supernatural hostile power. Players assume the role of Harkyn, a human hero seeking to defeat threatening villains. According to the storyline, the main character is released from prison, where he was held for his sins, in order to protect the world. While wandering around the in-game world, the protagonist, controlled by players, eliminate bosses and earn experience points. As far as Harkyn has a branch of abilities, both combat and magical parameters can be upgraded with experience. In addition to the main story, players are able to complete various side quests, which expand the whole picture of the game, to gain extra experience or to unlock new equipment. Character’s customization ability allows creating a heavy knight as well as a lightweight attacker. The gameplay also features the progress-saving system: if dead, players can return to the ghost (remaining on the place of death) and get their progress back.', 93, 723, 'data:image/jpeg;base64,', 10);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(6, 'Vampire: The Masquerade - Bloodlines 2', 1, 8, 'About\r\nSired in an act of vampire insurrection, your existence ignites the war for Seattle\'s blood trade. Enter uneasy alliances with the creatures who control the city and uncover the sprawling conspiracy which plunged Seattle into a bloody civil war between powerful vampire factions.\r\nBecome the Ultimate Vampire\r\nImmerse yourself in the World of Darkness and live out your vampire fantasy in a city filled with intriguing characters that react to your choices. You and your unique disciplines are a weapon in our forward-driving, fast-moving, melee-focussed combat system. Your power will grow as you advance, but remember to uphold the Masquerade and guard your humanity... or face the consequences.\r\nDescend into Seattle’s Dark Heart and Survive the Vampire Elite\r\nSeattle has always been run by vampires. Hunt your prey across Seattle locations faithfully reimagined in the World of Darkness. Meet the old blood founders present since the city’s birth and the new blood steering the tech money redefining the city. Everyone has hidden agendas - so choose your allies wisely.\r\nEnter into Uneasy Alliances\r\nChoose a side among competing factions, each with their own unique traits and stories, in the war for Seattle’s blood trade. The world will judge you by the company you keep, but remember no one’s hands stay clean forever.\r\nExperience the Story\r\nWritten by the creative mind behind the original Bloodlines, Vampire: The Masquerade® - Bloodlines™ 2 brings the ambitions of the first game to life and sees the return of a few fan favorite characters.', 35, 248, 'data:image/jpeg;base64,', 10);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(51, 'S.T.A.L.K.E.R. 2: Heart of Chornobyl', 5, 7, 'About\r\nS.T.A.L.K.E.R. 2 is a brand-new entry in the legendary series, enjoyed by millions of players worldwide.\r\n\r\nThe explosive combination of first-person shooter, immersive sim and horror is back. It’s the ultimate S.T.A.L.K.E.R. experience of unprecedented scale, advanced graphics, freedom of choices and the thickest atmosphere of a deadly adventure.\r\n\r\nWelcome to The Zone — an area of exclusion around the Chernobyl Nuclear Power Plant. Full of radiation, mutants and anomalies, it keeps drawing adventurers from beyond the perimeter.\r\n\r\nBounty hunters dwell deep into the Zone, driven by its treasures and mysteries. These people are known as stalkers.\r\n\r\nAre you ready to become one of them?', 5, 21, 'data:image/jpeg;base64,', 6);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(52, 'Lego Star Wars: The Skywalker Saga', 6, 8, 'The galaxy is yours with LEGO® Star Wars™: The Skywalker Saga! Play through all nine Star Wars™ saga films in a brand-new LEGO video game unlike any other. Experience fun-filled adventures, whimsical humor, and the freedom to fully immerse yourself in the Star Wars universe like never before.\r\n\r\nFor the first time ever in a LEGO video game, explore the galaxy your way as you fly to some of the saga\'s most legendary locales. You can start your journey with Star Wars™: The Phantom Menace for some podracing on Tatooine. Or choose to launch right into Rey\'s adventures in Star Wars™: The Rise of Skywalker. Players have the freedom to seamlessly travel to any planet, in any order, at any time.\r\n\r\nJourney to a galaxy far, far away with LEGO Star Wars: The Skywalker Saga.\r\n\r\n', 4, 24, 'data:image/jpeg;base64,', 6);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(53, 'Tiny Tina\'s Wonderlands', 4, 10, 'Embark on an epic adventure full of whimsy, wonder, and high-powered weaponry! Bullets, magic, and broadswords collide across this chaotic fantasy world brought to life by the unpredictable Tiny Tina. Roll your own multiclass hero and loot, shoot, slash, and cast your way through outlandish monsters and loot-filled dungeons on a quest to stop the tyrannical Dragon Lord. Everyone\'s welcome, so join the party, throw on your adventuring boots, and be Chaotic Great!', 8, 56, 'data:image/jpeg;base64,', 11);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(54, 'The Legend of Zelda: Breath of the Wild (Sequel)', 2, 9, 'The Legend of Zelda: Link\'s Awakening (2019), Cadence of Hyrule, The Legend of Zelda: Breath of the Wild, Hyrule Warriors Legends, The Legend of Zelda: Tri Force Heroes, The Legend of Zelda: Majora\'s Mask 3D, Hyrule Warriors, The Legend of Zelda: A Link Between Worlds, The Legend of Zelda: Skyward Sword, The Legend Of Zelda: Four Swords Anniversary Edition, The Legend of Zelda: Ocarina of Time 3D, The Legend of Zelda: Spirit Tracks, The Legend of Zelda: Phantom Hourglass, The Legend of Zelda: Twilight Princess, The Legend of Zelda: The Minish Cap, The Legend of Zelda: Four Swords Adventures, The Legend of Zelda: The Wind Waker, The Legend of Zelda: Four Swords, The Legend of Zelda: Oracle of Seasons, The Legend of Zelda: Oracle of Ages, The Legend of Zelda: Majora\'s Mask, The Legend of Zelda: Ocarina of Time, The Legend of Zelda: Link\'s Awakening (1993), The Legend of Zelda: Link\'s Awakening, The Legend of Zelda: A Link to the Past, Zelda II: The Adventure of Link, The Legend of Zelda', 3, 18, 'data:image/jpeg;base64,', 9);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(71, 'Starfield', 2, 9, 'Starfield is the first new universe in 25 years from Bethesda Game Studios, the award-winning creators of The Elder Scrolls V: Skyrim and Fallout 4. In this next generation role-playing game set amongst the stars, create any character you want and explore with unparalleled freedom as you embark on an epic journey to answer humanity’s greatest mystery.', 11, 57, 'data:image/jpeg;base64,', 9);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(72, 'Diablo IV', 3, 10, 'Meet Your Maker Lilith has returned to Sanctuary, summoned by a dark ritual after eons in exile. Her return ushers in an age of darkness and misery.', 4, 20, 'data:image/jpeg;base64,', 11);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
(73, 'Hogwarts Legacy', 4, 10, 'Hogwarts Legacy is an immersive, open-world action RPG set in the world first introduced in the Harry Potter books. Now you can take control of the action and be at the center of your own adventure in the wizarding world. Embark on a journey through familiar and new locations as you explore and discover fantastic beasts, customize your character and craft potions, master spell casting, upgrade talents, and become the wizard you want to be.\n\nExperience Hogwarts in the 1800s. Your character is a student who holds the key to an ancient secret that threatens to tear the wizarding world apart. You have received a late acceptance to the Hogwarts School of Witchcraft and Wizardry and soon discover that you are no ordinary student: you possess an unusual ability to perceive and master Ancient Magic. Only you can decide if you will protect this secret for the good of all, or yield to the temptation of more sinister magic.\n\nDiscover the feeling of living at Hogwarts as you make allies, battle Dark wizards, and ultimately decide the fate of the wizarding world. Your legacy is what you make of it.', 2, 14, 'data:image/jpeg;base64,', 6);
INSERT INTO `games` (`id`, `title`, `type`, `category`, `about`, `count`, `sum`, `photo`, `author_id`) VALUES
